import React from 'react';

class Spinach extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type :"Vegetables",
      name: "Spinach",
      quantity:200,

    };
  }
  render() {
    return (
      <div>
        <img src = "/images/spinach.jpeg" alt="" />
        <ul>
          <p>Type:{this.state.type}</p>
          <p>Name:{this.state.name}</p>
          <p>Quantity:{this.state.quantity}</p>
        </ul>
      </div>
    );
  }
}

class Onions extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type: "Vegetables",
      name: "Onions",
      quantity:300,

    };
  }
  render() {
    return (
      <div >
        <img src = "/images/onions.jpeg" alt=""  />
        <ul>
          <p>Type:{this.state.type}</p>
          <p>Name:{this.state.name}</p>
          <p>Quantity:{this.state.quantity}</p>
        </ul>
      </div>
    );
  }
}


class Oranges extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      type: "Fruits",
      name: "Oranges",
      quantity:250,

    };
  } 
  render() {
    return (
      <div>

        <img src = "/images/oranges.jpeg" alt = "" />
        <ul>
          <p>Type:{this.state.type}</p>
          <p>Name:{this.state.name}</p>
          <p>Quantity:{this.state.quantity}</p>
        </ul>
        <Spinach />
        <Onions />
      </div>
    );
  }
}


export default Oranges;
